import React, { useState } from 'react'
import { PiServerGrid, PiButton } from 'pixel-kit'
// import { PiAvatar } from 'pixel-kit'
// import 'pixel-kit/dist/index.css'
// import {PiProductCard} from 'pixel-kit'
// import {PiAddress} from 'pixel-kit'
// import {PiDropdownMenu} from 'pixel-kit'
// import {PiFilters} from 'pixel-kit'
// import {PiAccordian, PiAccordianItem, PiAccordianHeader, PiAccordianPanel} from 'pixel-kit'
// const page = 1
const baeurl = 'https://www.ag-grid.com/example-assets/olympic-winners.json'
const App = () => {
  let [page, setPage] = useState(1)
  let [test, setTest] = useState('')

  const serverFilterData = {
    contact_type: [
      { id: '6b4ef73f-5d6e-4b3a-9003-e7af45dafd70', name: 'Test COntact TYp' },
      {
        id: '994532b2-b5c9-4faf-af06-ad45eef368ec',
        name: 'Sales Representative'
      },
      { id: '3c3ea22c-9418-4df1-9161-4db652b53cf6', name: 'Patch Update' }
    ]
  }
  let [cellValueData, setCellValueData] = useState({
    body: {},
    method: 'GET',
    headers: {},
    // url: ' https://buzzworlddev-iidm.enterpi.com:8446/v1/Contacts?page=1'
    url: `${baeurl}`
  })

  // let cellValueData = {
  //   body: {},
  //   method: 'GET',
  //   page: page,
  //   headers: {},
  //   // url: ' https://buzzworlddev-iidm.enterpi.com:8446/v1/Contacts?page=1'
  //   url: `${baeurl}`
  // }
  function gridready(e: any) {
    console.log(e)
    // e.api.paginationGoToPage(3)
  }
  function handle() {
    test = 'new'
    setTest(test)
    page = page + 1
    setPage(page)

    setCellValueData({
      body: {
        branch_id: page,
        test: test
      },
      method: 'GET',
      headers: {},
      url: `${baeurl}`
    })
    // gridEvent.api.paginationGoToPage(3)
  }

  // const billing: any = {
  //   address1: '123',
  //   address2: '12345',
  //   city: 'Hyderabad',
  //   street: 'steet name',
  //   state: 'Telangana',
  //   country: 'India',
  //   zip: 500062
  // }
  // return <PiAvatar appearance="circle" src="https://hello.atlassian.net/secure/projectavatar?pid=30630"/>

  return (
    <div className='form-styles'>
      <PiServerGrid
        columns={[
          {
            editable: true,
            field: 'contact_type',
            sortable: true,
            filter: true,
            filterParams: {
              values: [
                'Test COntact TYp',
                'Sales Representative',
                'Patch Update'
              ]
            }
          },
          {
            field: 'country'
          },
          {
            field: 'age'
          },
          {
            field: 'sport'
          }
        ]}
        mode='paginate'
        searchValue={test}
        pageNumber={page}
        serverFilterOptions={serverFilterData}
        onGridReady={gridready}
        requestInfo={cellValueData}
        rowHeight={50}
      />

      <PiButton
        appearance='primary'
        label='Primary'
        libraryType='atalskit'
        onClick={handle}
      />
    </div>
  )
}

export default App
